import {Link} from 'react-router-dom'

function InfoPage(props){
    return(
        <div>
            <div id="title">
                <Link to="/"><h1>SCAT</h1></Link>
            </div>
            <div>
                <h2>Project Name : {props.match.params.username}</h2>
            </div>
        </div>
    );
}

export default InfoPage;
